import "./App.css";
import Landing from "./components/Landing";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div>
      <h1 className="text-1xl font-bold underline">Hello world!</h1>
      <Navbar />
      <Landing />
    </div>
  );
}

export default App;
